import React, { Component } from 'react';

const ImageSlide = ({ url }) => {
    const styles = {
      //backgroundImage: `url(${url})`,
      //backgroundSize: 'cover',
      //backgroundPosition: 'center'
      width: '50',
      height: '50'
    };
  
    return (
      <div className="image-slide" style={styles}></div>
    );
  }
